import { Link } from "react-router-dom";
import classes from "./CardPresentationItem.module.css";

const CardPresentationItem = (props) => {
  return (
    <li className={classes.cardItem}>
      <Link className={classes.cardItemLink} to="/">
        <figure className={classes.cardItemPicWrap}>
          <img src={props.imgSrc} alt="Gym" className={classes.cardItemImg} />
        </figure>
        <div className={classes.cardItemInfo}>
          <h5 className={classes.cardItemText}>{props.type}</h5>
        </div>
      </Link>
    </li>
  );
};

export default CardPresentationItem;
